import { Router, Routes, Route } from "react-router";
function App() {
  return (
    <>
    <Router>
    <Routes>
      <Route path="/" element={<App />} />
    </Routes>
    </Router>

     <div className="App">
     <h1 style={{ textAlign: 'center' }}>hello world</h1>
    </div>
    </>

  );
}

export default App;
